// frontend/src/app.js
import React from 'react';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import Dashboard from './pages/Dashboard';
import EventSender from './pages/EventSender';
import Preview from './pages/Preview';
import 'bootstrap/dist/css/bootstrap.min.css';

function App() {
  return (
    <Router>
      <nav style={{ padding: '1rem', backgroundColor: '#f5f5f5' }}>
        <Link style={{ marginRight: '1rem' }} to="/">Dashboard</Link>
        <Link style={{ marginRight: '1rem' }} to="/event-sender">Event Sender</Link>
        <Link to="/preview">Preview</Link>
      </nav>
      <div className="container mt-4">
        <Routes>
          <Route path="/" element={<Dashboard />} />
          <Route path="/event-sender" element={<EventSender />} />
          <Route path="/preview" element={<Preview />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
